definition.logic:
exists ( ["Patient Characteristic Birthdate": "Birth date"] Birthdate
                    where Common."CalendarAgeInYearsAt"(Birthdate.birthDatetime, start of "Measurement Period")>= 66
                    )
                    and Common."Product Line"("Product Line",
                    end of "Measurement Period", "Measurement Period"
                    )= Common."Medicare Product"

Common."Is Enrolled"("Product Line",
                    end of "Measurement Period", Interval[start of "Measurement Period",
                    end of "Measurement Period"], 45
                    )

exists ( ( ["Immunization, Administered": "Herpes Zoster Live Immunization"]
                    union ( ["Procedure, Performed": "Herpes Zoster Live Vaccine Procedure"] ZosterLiveProcedure
                    return "Immunization, Administered" { authorDatetime: start of ZosterLiveProcedure.relevantPeriod }
                    ) ) ZosterLive
                    with ["Patient Characteristic Birthdate": "Birth date"] BirthDate
                    such that Common."CalendarAgeInYearsAt"(BirthDate.birthDatetime, ZosterLive.authorDatetime)>= 50
                    ) ZosterLiveAge50
                    where ZosterLiveAge50.authorDatetime on or before
                    end of "Measurement Period"

exists ( ( ["Immunization, Administered": "Adult Influenza Immunization"]
                    union ["Immunization, Administered": "Influenza Virus LAIV Immunization"]
                    union ( ["Procedure, Performed": "Adult Influenza Vaccine Procedure"] FluVaccineProcedure
                    return "Immunization, Administered" { authorDatetime: start of FluVaccineProcedure.relevantPeriod }
                    )
                    union ( ["Procedure, Performed": "Influenza Virus LAIV Vaccine Procedure"] FluLAIVVaccineProcedure
                    return "Immunization, Administered" { authorDatetime: start of
                    FluLAIVVaccineProcedure.relevantPeriod }
                    ) ) FluVaccine
                    where FluVaccine.authorDatetime during Interval[( start of "Measurement Period" - 6 months ), (
                    start of "Measurement Period" + 6 months ) )
                    )
                    or "Influenza Virus Vaccine Adverse Reaction Before End of Measurement Period"

exists ( ["Immunization, Administered": "Tdap Immunization"]
                    union ["Immunization, Administered": "Td Immunization"]
                    union ( ["Procedure, Performed": "Tdap Vaccine Procedure"] TdapVaccine
                    return "Immunization, Administered" { authorDatetime: start of TdapVaccine.relevantPeriod }
                    )
                    union ( ["Procedure, Performed": "Td Vaccine Procedure"] TdVaccine
                    return "Immunization, Administered" { authorDatetime: start of TdVaccine.relevantPeriod }
                    ) ) TdapOrTdvaccine
                    where TdapOrTdvaccine.authorDatetime during Interval[( start of "Measurement Period" - 9 years ), (
                    end of "Measurement Period"
                    )]
